import React from 'react';

import classes from './Car.module.css';

const car = (props) => {
    let timeSince = (time) => {
        const currentTime = new Date();
        const timeSinceArray = [];
        // timeSinceArray.push(`${currentTime.getDate() - time.getDate()}d`);
        timeSinceArray.push(`${currentTime.getHours() - time.getHours()}h`);
        timeSinceArray.push(`${currentTime.getMinutes() - time.getMinutes()}m`);
        return timeSinceArray.join(' ');
    }
    return (
        <div className={classes.Car}>
            <p className={classes.Ticket}>{props.ticket}</p>
            <p>{timeSince(props.time)}</p>
        </div>
    )
}

export default car;
